import React from 'react';
import styles from "./contacts.module.css"

function MyMap() {

  return (
    <div id="map">
      <div className="container">
        <div className="map_content"></div>
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3034.1005830379004!2d72.8267437!3d40.4951588!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x38bdae680551f8c1%3A0xee31f3f7356fc40!2sKyrgyz-Uzbek%20University!5e0!3m2!1sen!2skg!4v1680786428935!5m2!1sen!2skg"
          width="600"
          height="450"
          style={{ border: 0 }}
          allowFullScreen=""
          loading="lazy"
          referrerPolicy="no-referrer-when-downgrade"
          title="myFrame"
        ></iframe>
        <img className={styles.img1} src="https://lh3.googleusercontent.com/p/AF1QipNekB2vsmsI_VVDm3mEFr5dWOjWZjX8wUvptVkB=s1360-w1360-h1020"></img>
      </div>

    </div>
  );
}

export default MyMap
